/**
 * Parses a number from the string until it hits delimiter 'd'
 */
long parsePr(const char*& ptr, char d) {
    long v = 0;
    while (*ptr && *ptr != d && *ptr != ' ' && *ptr != '|' && *ptr != ';') {
        v = v * 10 + (*ptr - '0');
        ptr++;
    }
    if (*ptr == d) ptr++;
    return v;
}

/**
 * Parses a base-36 string (0-9, a-z) into an integer
 */
int b36Pr(std::string s) {
    int res = 0;
    for (char c : s) {
        res *= 36;
        if (c >= '0' && c <= '9') res += (c - '0');
        else if (c >= 'a' && c <= 'z') res += (10 + (c - 'a'));
    }
    return res;
}
      
/**
 * Decodes the custom art format and draws it using native screen functions
 */
void drawArt(const char* data) {
    // clear the screen to black
    pros::screen::set_eraser(0x000000); 
    pros::screen::erase();

    const char* ptr = data;
    
    // Parse the step size (pixel size)
    int step = parsePr(ptr, '|');

    // Parse the Color Palette
    std::vector<uint32_t> pal;
    while (*ptr && *ptr != '|') {
        char hex[7]; 
        int h = 0;
        while (*ptr && *ptr != ',' && *ptr != '|' && *ptr != ' ') {
            if (h < 6) hex[h++] = *ptr; 
            ptr++;
        }
        hex[h] = '\0';
        // Convert hex string to uint32 color
        pal.push_back((uint32_t)strtol(hex, NULL, 16));
        
        if (*ptr == ',' || *ptr == ' ') ptr++;
    }
    if (*ptr == '|') ptr++;

    // Draw the Pixels
    int x = 0, y = 0;
    while (*ptr) {
        // Newline character
        if (*ptr == ';') { 
            x = 0; 
            y += step; 
            ptr++; 
            continue; 
        }

        // Parse index string and run-length string
        std::string iS = "", lS = "";
        while (*ptr && *ptr != '.') iS += *ptr++; 
        if (*ptr == '.') ptr++;
        while (*ptr && *ptr != ',' && *ptr != ';') lS += *ptr++; 
        if (*ptr == ',') ptr++;

        int cIdx = b36Pr(iS); // Color Index
        int run = b36Pr(lS);  // Run Length (number of blocks)

        if (cIdx < pal.size()) {
            // Set the pen color from the palette
            pros::screen::set_pen(pal[cIdx]);
            
            // Draw the run of rectangles
            for (int k = 0; k < run; k++) {
                if (y >= 240) return; // Bounds check
                
                // Draw filled rectangle on the native screen
                pros::screen::fill_rect(x, y, x + step, y + step);
                x += step;
            }
        }
    }
}

// 1. The Callback Function
static void button_event_cb(lv_event_t * e) {
    lv_event_code_t code = lv_event_get_code(e);
    
    // Explicit cast for C++ compatibility in PROS
    lv_obj_t * btn = (lv_obj_t*)lv_event_get_target(e);

    if(code == LV_EVENT_CLICKED) {
        // Retrieve the ID stored in user_data
        int btn_id = (intptr_t)lv_obj_get_user_data(btn);      

        if (btn_id == 0) {
            // Logic for the first button (Top Left)
            if (scene == 'M') {     //"M'ain menue
                pros::delay(200);
                drawArt(vexProg);
                scene = 'G';        // 'G'ame (vexProg)
            } else if (scene == 'G') {
                pros::delay(200);
                drawArt(mainMenue);
                scene = 'M';
            } else if (scene == 'F') {   //'F'older (user)
                pros::delay(200);
                drawArt(UserProg);
                scene = 'P';   //'P'rograms (UserProg)
            } else if (scene == 'P') {
                pros::delay(200);
                drawArt(mainMenue);
                scene = 'M';
            } else if (scene == 'S') {   //'S'ettings
                pros::delay(200);
                drawArt(mainMenue);
                scene = 'M';
            } else if (scene == 'V'){  //'V'ex folder
                pros::delay(200);
                drawArt(vexProg);
                scene = 'G';
            } else if (scene == 'D'){  //'D'evices
                pros::delay(200);
                drawArt(mainMenue);
                scene = 'M';
            }
        }
        if (btn_id == 1) {
            // Logic for the second button (Top Center)
            if (scene == 'M') {     //"M'ain menue
                pros::delay(200);
                drawArt(devices);
                scene = 'D';        // 'D'evices
            } else if (scene == 'D') {
                pros::delay(200);
                drawArt(mainMenue);
                scene = 'M';
            } else if (scene == 'S') {   //'S'ettings
                pros::delay(200);
                drawArt(mainMenue);
                scene = 'M';   //'D'evices
            } else if (scene == 'D'){
                pros::delay(200);
                drawArt(mainMenue);
                scene = 'M';
            }
        }
    }
}


void create_invisible_buttons() {
    int grid_cols = 4;
    int grid_rows = 2;
    int btn_w = 480 / grid_cols; // 160px
    int btn_h = 240 / grid_rows; // 120px

    for (int i = 0; i < 8; i++) {
        // LVGL 9 uses lv_button_create and lv_screen_active
        lv_obj_t * btn = lv_button_create(lv_screen_active());

        int x = (i % grid_cols) * btn_w;
        int y = (i / grid_cols) * btn_h;

        lv_obj_set_pos(btn, x, y);
        lv_obj_set_size(btn, btn_w, btn_h);

        // --- STYLING ---
        // Make the button body and border transparent
        lv_obj_set_style_bg_opa(btn, LV_OPA_TRANSP, 0);
        lv_obj_set_style_border_opa(btn, LV_OPA_TRANSP, 0);
        lv_obj_set_style_bg_opa(lv_layer_bottom(), LV_OPA_TRANSP, 0);
        lv_obj_set_style_bg_opa(lv_screen_active(), LV_OPA_TRANSP, 0);
        lv_obj_set_style_bg_opa(btn, LV_OPA_TRANSP, LV_STATE_ANY);
        lv_obj_set_style_border_opa(btn, LV_OPA_TRANSP, LV_STATE_ANY);
        lv_obj_set_style_shadow_width(btn, 0, LV_STATE_ANY);
        lv_obj_set_style_shadow_width(btn, 0, 0);

        // Store the loop index 'i' so we know which button is which
        lv_obj_set_user_data(btn, (void*)(intptr_t)i);
        
        // Register the click event
        lv_obj_add_event_cb(btn, button_event_cb, LV_EVENT_CLICKED, NULL);
    }
}

